  [],\n\t\"revision_timestamp\": \"2016-07-27T22:54:39.409855\",\n\t\"name\": \"narrative-report-for-upper-souris-refuge-september-thru-december-1952\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Upper Souris
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1952. The report begins by summarizing the weather conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing, haying, and fur harvesting. A progress report on field investigations and
  applied research is included. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
